import React from 'react';
import './CuisineCategories.css';

function CuisineCategories() {
    const cuisines = [
        { name: 'Italian', description: 'Enjoy the rich flavors of Italian dishes like pizza and pasta.' },
        { name: 'Chinese', description: 'Savor the bold flavors of traditional Chinese cooking.' },
        // Add other cuisines here...
    ];

    const partners = [
        { name: 'Foodie Corp', description: 'A trusted provider of fresh ingredients and culinary inspiration.' },
        { name: 'Gourmet World', description: 'Bringing gourmet flavors from around the world to your kitchen.' },
        // Add other partners here...
    ];

    return (
        <section className="cuisines">
            <h2>Explore International Cuisines</h2>
            <div className="cuisine-list">
                {cuisines.map((cuisine, index) => (
                    <div key={index} className="cuisine">
                        <h3>{cuisine.name}</h3>
                        <p>{cuisine.description}</p>
                    </div>
                ))}
            </div>

            <h2>Our Partners</h2>
            <div className="partner-list">
                {partners.map((partner, index) => (
                    <div key={index} className="partner">
                        <h3>{partner.name}</h3>
                        <p>{partner.description}</p>
                    </div>
                ))}
            </div>
        </section>
    );
}

export default CuisineCategories;
